      date: new Date(2022, 8, 17)}, 
    {
      title: 'Gas',
      amount: 45.31,
      date: new Date(2022, 7, 26)},
    {
      title: 'groceries',
      amount: 150.57,
      date: new Date(2022, 8, 4)},
    { 
      title: 'mortgage',
      amount: 1421.00, 
      date: new Date(2022, 8, 17)}
];
